import { redirect } from "react-router-dom";

export default function NotFound() {
  const handleClick = () => {
    return redirect('/', 404);
  };

  return (
    <div
      style={{
        textAlign: 'center'
      }}
      className="error"
    >
        <h1>
            Sorry, the page you were<br />
            looking for is not found.
        </h1>
        <button onClick={handleClick}>Return to home</button>
    </div>
  );
};
